import React,{useState,useEffect} from 'react'
import AxiosRequest from '../../axios'


const CartDetails = () => {

    const [cartData,setCartData] = useState([])
    const retrieveCart = async() => {
        const cartData = await AxiosRequest.get(`/shareme/cart/1`)
                        .then((res) => {
                            console.log(res);
                            setCartData(res.data)
                        })
                        .catch((err) => {console.log(err)})
    }

    const RenderCart = cartData.map((each) => {
        console.log(each);
        return(

            <div style={{backgroundColor:"white"}}>
                <p>{each.seller} {each.buyer}</p>
                <p>NetPrice:{each.net_price} Quantity: {each.quantity}</p>
            </div>
        );
    })


    return (
    <div>
        CartDetails
    </div>
  )
}

export default CartDetails;
